import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';

function StartScreen() {
  const [isStarted, setIsStarted] = useState(false);
  const navigate = useNavigate();

  const onStartClick = () => {
    setIsStarted(true);
    navigate("/quiz");
  };

  return (
    <div className='startScreen'>
      <h1 className='quizTravel'>Quiz Travel</h1>
      <p className='quizRules'>Mettiti alla prova con questo quiz di 10 domande sul turismo sostenibile e scopri quanto ne sai!</p>
      <button className='buttonInit' onClick={onStartClick}>Inizia il quiz</button>
    </div>
  );
}

export default StartScreen;
